  return (
    <div>
      <div className="about-page">
        <h2>About Us</h2>
        <p>
          Welcome to our food delivery service! We are dedicated to providing
          delicious meals delivered right to your doorstep.
        </p>
        <p>
          Our mission is to offer convenient and high-quality food delivery
          options to our customers, ensuring satisfaction with every order.
        </p>
